import { Outlet } from "react-router-dom";
import {useState} from "react";

const Header = () => {

  const [modalState, setModalState] = useState(false);


  const openRegModal = () => {
    setModalState(true)
  }

  return <>
    <div>HEADER</div>
    <button onClick={openRegModal}>Sign in</button>

    {
        modalState ? <div>My modal</div> : null
    }



    <Outlet />
  </>

};

export default Header;
